function CategoriesItem(props) {
	const category = [
		{
			id: 'e1',
			title: 'History',
		},
		{ id: 'e2', title: 'Math' },
		{ id: 'e3', title: 'Music' },
	];
	return (
		<div>
			<h1>Wybierz kategorie</h1>
			<a href='./quiz.html'>
				<div class='button'>{category[0].title}</div>
			</a>
		</div>
	);
}

export default CategoriesItem;
